'mail/chrome/messenger/addressbook/ldapAutoCompErrs.properties:10087' => 'ચકાસો કે શોધ ગાળક ખરું છે, અને ફરીથી પ્રયત્ન કરો, અથવા તમારા સિસ્ટમ સંચાલકનો સંપર્ક કરો. શોધ ગાળક યોગ્ય છે તે ચકાસવા માટે, ફેરફાર મેનુમાંથી, પસંદગીઓ પસંદ કરો, પછી મેલ &amp; સમાચાર જૂથો પસંદ કરો, અને પછી સરનામાકરણ પસંદ કરો. ડિરેક્ટરીઓમાં ફેરફાર કરો પર ક્લિક કરો, અને LDAP સર્વર વપરાયેલ છે તે પસંદ કરો. ફેરફાર કરો પસંદ કરો, અને પછી શોધ ગાળક પ્રદર્શિત કરવા માટે ઉન્નત પર ક્લિક કરો.',
